import React from "react";
import { Center, Box, Heading, Grid } from "@chakra-ui/react";

const data = [
  {
    emojis: "😡",
    bgColor: "red",
  },
  {
    emojis: "😕",
    bgColor: "red",
  },
  {
    emojis: "😶",
    bgColor: "red",
  },
  {
    emojis: "😁",
    bgColor: "red",
  },
  {
    emojis: "😍",
    bgColor: "red",
  },
];

export const Reactions: React.FC = () => {
  return (
    <Box h={"100vh"}>
      <Center h={"100%"}>
        <Grid
          h={10}
          w={{ base: "90%", md: "600px" }}
          templateColumns="repeat(5, 1fr)"
          gap={6}
        >
          <Box w="100%" h="10" textAlign="center">
            <Heading fontSize={"44px"}>😡</Heading>
          </Box>
          <Box w="100%" h="10" textAlign="center">
            <Heading fontSize={"44px"}>😕</Heading>
          </Box>
          <Box w="100%" h="10" textAlign="center">
            <Heading fontSize={"44px"}>😶</Heading>
          </Box>
          <Box w="100%" h="10" textAlign="center">
            <Heading fontSize={"44px"}>😁</Heading>
          </Box>
          <Box w="100%" h="10" textAlign="center">
            <Heading fontSize={"44px"}>😍</Heading>
          </Box>
        </Grid>
      </Center>
    </Box>
  );
};
